import {useEffect, useState} from "react";
// import { BrowserRouter, Routes, Route } from 'react-router-dom';
// import StorageList from "./pages/storage/StorageList";
import Login from "./pages/mypage/Login";
// import DetaileStorage from "./pages/storage/DetaileStorage";
import {authService} from "./firebase";
import AppRouter from "./components/CustomRouter";

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [init, setInit] = useState(false);

  useEffect(() => {
    authService.onAuthStateChanged((user) => {
      if(user){
        setIsLoggedIn(true);
      } else {
        setIsLoggedIn(false);
      }
      setInit(true);
    });
  }, []);

  return (
    <div className="App">
      {/*<BrowserRouter>*/}
      {init ? (
        isLoggedIn ? <AppRouter isLoggedIn={isLoggedIn} /> : <Login setIsLoggedIn={setIsLoggedIn} />
      ) : (
        <img src="imgs/ot417_1.png"
             alt="로딩 이미지"
             style={{}}/>
      )}
          {/*<Routes>*/}
          {/*  <Route path='/logout' element={<Logout/>}></Route>*/}
          {/*  <Route path='/storagelist' element={<StorageList />}></Route>*/}
          {/*  <Route path='/detailestorage' element={<DetaileStorage />}></Route>*/}
          {/*</Routes>*/}
      {/*</BrowserRouter>*/}
    </div>
  );
}

export default App;
